import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const StockDetailPage = () => {
  const { id } = useParams(); // Get the id from the URL
  const [stockDetails, setStockDetails] = useState(null);

  useEffect(() => {
    axios
      .get(`http://127.0.0.1:8000/${id}`)
      .then((response) => {
        setStockDetails(response.data);
      })
      .catch((err) => {
        alert(err);
      });
  }, [id]);

  return (
    <div className="App">
      <h2 className='App-header'>Stock Details for ID: {id}</h2>
      {stockDetails ? (
        <table className='table '>            
          <tr><td>Date</td> <td>{stockDetails.date}</td></tr>
          <tr><td>Trade Code:</td> <td> {stockDetails.trade_code}</td></tr>
          <tr><td>High:</td> <td>{stockDetails.high}</td></tr>
          <tr><td>Low: </td> <td>{stockDetails.low}</td></tr>
          <tr><td>Open:</td> <td> {stockDetails.open}</td></tr>
          <tr><td>Close: </td> <td>{stockDetails.close}</td></tr>
          <tr><td>Volume: </td> <td>{stockDetails.volume}</td></tr>
        </table>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default StockDetailPage;
